import React from "react"
import Messages from "./Messages";

// id={m.id} key={m.id} messageText={m.body}
// recipientId={m.recipientId} senderId={m.senderId}
// senderName={m.senderName}
// translatedBody={m.translatedBody}
// viewed={m.viewed} totalCount={m.totalCount}
// addedAt={m.addedAt}

class MessagesContainer extends React.Component {



    render() {

        return (
            <Messages activeDialogId={this.props.activeDialogId} dialogsPage={this.props.dialogsPage}
                     getMessages={this.props.getMessages}  numberOfPage={this.props.numberOfPage}
                     messagePageSize={this.props.messagePageSize} authUserId={props.authUserId}
                      setMessageViewed={props.setMessageViewed}/>
        )
    }
}

export default MessagesContainer
